import React from 'react';

export const Header = (props) => {
  return (
    <div style={styles.headerStyle}>
      {props.children}
    </div>
  );
};

const styles = {
  headerStyle: {
    position: 'relative',
    height: 50,
    padding: 10,
    height: 'auto',
    width: 'auto',
    borderBottom: '2px solid grey',
  },
};
